CREATE SCHEMA IF NOT EXISTS jal_op;

CREATE TABLE IF NOT EXISTS jal_op.departure (
    id UUID PRIMARY KEY NOT NULL,
    date TIMESTAMP WITH TIME ZONE NOT NULL,
    valid TIMESTAMP WITH TIME ZONE NOT NULL,
    flight_number VARCHAR(255) NOT NULL,
    departure_airport VARCHAR(255),
    destination_airport VARCHAR(255),
    flight_status VARCHAR(255),
    scheduled_departure_time TIMESTAMP WITH TIME ZONE,
    estimated_departure_time TIMESTAMP WITH TIME ZONE,
    actual_departure_time TIMESTAMP WITH TIME ZONE
);

CREATE TABLE IF NOT EXISTS jal_op.arrival (
    id UUID PRIMARY KEY NOT NULL,
    date TIMESTAMP WITH TIME ZONE NOT NULL,
    valid TIMESTAMP WITH TIME ZONE NOT NULL,
    flight_number VARCHAR(255) NOT NULL,
    origin_airport VARCHAR(255),
    arrival_airport VARCHAR(255),
    flight_status VARCHAR(255),
    scheduled_arrival_time TIMESTAMP WITH TIME ZONE,
    estimated_arrival_time TIMESTAMP WITH TIME ZONE,
    actual_arrival_time TIMESTAMP WITH TIME ZONE
);

CREATE SCHEMA IF NOT EXISTS weather;

CREATE TABLE IF NOT EXISTS weather.observatory (
    id INTEGER PRIMARY KEY NOT NULL,
    prefecture VARCHAR(255) NOT NULL,
    name VARCHAR(255) NOT NULL,
    international_id INTEGER
);

CREATE TABLE IF NOT EXISTS weather.precipitation (
    id UUID PRIMARY KEY NOT NULL DEFAULT gen_random_uuid(),
    observatory_id INTEGER NOT NULL REFERENCES weather.observatory(id) ON UPDATE CASCADE ON DELETE CASCADE,
    timestamp TIMESTAMP WITH TIME ZONE,
    value_mm DOUBLE PRECISION,
    value_quality INTEGER
);

CREATE TABLE IF NOT EXISTS weather.max_wind_speed (
    id UUID PRIMARY KEY NOT NULL DEFAULT gen_random_uuid(),
    observatory_id INTEGER NOT NULL REFERENCES weather.observatory(id) ON UPDATE CASCADE ON DELETE CASCADE,
    timestamp TIMESTAMP WITH TIME ZONE,
    max_today_mps DOUBLE PRECISION,
    max_today_value_quality INTEGER,
    max_today_direction_degree DOUBLE PRECISION,
    max_today_direction_value_quality INTEGER,
    max_today_timestamp TIMESTAMP WITH TIME ZONE,
    max_today_timestamp_value_quality INTEGER
);

CREATE TABLE IF NOT EXISTS weather.max_instantaneous_wind_speed (
    id UUID PRIMARY KEY NOT NULL DEFAULT gen_random_uuid(),
    observatory_id INTEGER NOT NULL REFERENCES weather.observatory(id) ON UPDATE CASCADE ON DELETE CASCADE,
    timestamp TIMESTAMP WITH TIME ZONE,
    max_today_mps DOUBLE PRECISION,
    max_today_value_quality INTEGER,
    max_today_direction_degree DOUBLE PRECISION,
    max_today_direction_value_quality INTEGER,
    max_today_timestamp TIMESTAMP WITH TIME ZONE,
    max_today_timestamp_value_quality INTEGER
);

CREATE TABLE IF NOT EXISTS weather.max_temperature (
    id UUID PRIMARY KEY NOT NULL DEFAULT gen_random_uuid(),
    observatory_id INTEGER NOT NULL REFERENCES weather.observatory(id) ON UPDATE CASCADE ON DELETE CASCADE,
    timestamp TIMESTAMP WITH TIME ZONE,
    max_today_degree_c DOUBLE PRECISION,
    max_today_value_quality INTEGER,
    max_today_timestamp TIMESTAMP WITH TIME ZONE,
    max_today_timestamp_value_quality INTEGER,
    diff_normal_degree_c DOUBLE PRECISION,
    diff_yesterday_degree_c DOUBLE PRECISION
);

CREATE TABLE IF NOT EXISTS weather.min_temperature (
    id UUID PRIMARY KEY NOT NULL DEFAULT gen_random_uuid(),
    observatory_id INTEGER NOT NULL REFERENCES weather.observatory(id) ON UPDATE CASCADE ON DELETE CASCADE,
    timestamp TIMESTAMP WITH TIME ZONE,
    min_today_degree_c DOUBLE PRECISION,
    min_today_value_quality INTEGER,
    min_today_timestamp TIMESTAMP WITH TIME ZONE,
    min_today_timestamp_value_quality INTEGER,
    diff_normal_degree_c DOUBLE PRECISION,
    diff_yesterday_degree_c DOUBLE PRECISION
);


